import Head from "next/head";
import Header from "./header";

import { CookiesProvider } from "react-cookie";

const Layout = (props) => (
  <React.Fragment>
    <Head>
      <title>Harrassment</title>
    </Head>

    <Header />

    {props.children}
  </React.Fragment>
);

export default Layout;
